import * as serviceWorker from './serviceWorker';
import store from "./redux/state/store";
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import BrowserRouter from "react-router-dom/modules/BrowserRouter";


let rerender_entire_tree = (state) => {
    ReactDOM.render(
        <BrowserRouter> <App state={store.get_state()}
                                dispatch={store.dispatch.bind(store)}
                               store={store}/>
        </BrowserRouter>,
        document.getElementById('root')
    );
}

rerender_entire_tree(store.get_state());
store.subscribe(rerender_entire_tree)
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
